description:
this collection contains very fresh riot grrrl sounds... to say it loud: we have 53 bands, over 2,5 hours of music and more than 200 mb of music here!!!

you find the links to the band in that rar-file as well as d.i.y. print masters, so you could help spreading the word for the compilation. (just print, copy, cut and leaflet around the world) 

we are very happy about everyone who is reblogging, posting, announcing, reviewing and sharing it. (dear tumblrs... not just favoriting ^-^)

